// 16000 sample rate
const dummyBase64Audio16k = ``;

const convert16Kto24K = (input: string): string => {
  // Decode base64 to binary data
  const binaryString = atob(input);
  const inputBytes = new Uint8Array(binaryString.length);
  for (let i = 0; i < binaryString.length; i++) {
    inputBytes[i] = binaryString.charCodeAt(i);
  }

  // Convert bytes to 16-bit signed integers (PCM16)
  const inputSamples = new Int16Array(inputBytes.buffer);
  const inputLength = inputSamples.length;

  // Calculate output length for 24kHz (1.5x more samples)
  const outputLength = Math.floor((inputLength * 24000) / 16000);
  const outputSamples = new Int16Array(outputLength);

  // Linear interpolation resampling
  for (let i = 0; i < outputLength; i++) {
    // Map output sample index to input sample position
    const inputPosition = (i * 16000) / 24000;
    const inputIndex = Math.floor(inputPosition);
    const fraction = inputPosition - inputIndex;

    if (inputIndex + 1 < inputLength) {
      // Interpolate between two adjacent samples
      const sample1 = inputSamples[inputIndex];
      const sample2 = inputSamples[inputIndex + 1];
      outputSamples[i] = Math.round(sample1 + fraction * (sample2 - sample1));
    } else {
      // Use last sample if we're at the end
      outputSamples[i] = inputSamples[inputIndex] || 0;
    }
  }

  // Convert back to bytes
  const outputBytes = new Uint8Array(outputSamples.buffer);

  // Encode to base64
  let binary = "";
  const chunkSize = 0x8000; // 32KB chunks to avoid call stack limits
  for (let i = 0; i < outputBytes.length; i += chunkSize) {
    const chunk = outputBytes.subarray(i, i + chunkSize);
    binary += String.fromCharCode.apply(null, Array.from(chunk));
  }

  return btoa(binary);
};

const dummyBase64Audio24K = convert16Kto24K(dummyBase64Audio16k);

export { dummyBase64Audio16k, dummyBase64Audio24K };
